import React, { useEffect, useState } from "react";
import Navbar from "../../components/Navbar";
import AdminPanel from "../../components/AdminPanel";
import Footer from "../../components/Footer";
import axios from "axios";
import { toast } from "react-toastify";
import { useNavigate } from "react-router-dom";

const AdminInvoiceData = () => {
  const [invoiceData, setInvoiceData] = useState([]);
  const apiUrl = window.location.origin.includes("localhost")
    ? "http://localhost:5000/admin/invoice_data"
    : "https://khamco-shop-backend.onrender.com/admin/invoice_data";
  const [isLoading, setIsLoading] = useState(true);
  const [display, setDisplay] = useState(false);
  const authKey = localStorage.getItem("jwt");
  const navigate = useNavigate();

  useEffect(() => {
    document.title = "Admin Invoice Data - Khamco Shop";
    const fetchInvoiceData = async () => {
      await axios
        .get(apiUrl, {
          headers: { Authorization: `Bearer ${authKey}` },
        })
        .then((response) => {
          setInvoiceData(response.data.invoice_data);
          setIsLoading(false);
          setDisplay(true);
        })
        .catch((error) => {
          setDisplay(false);
          setIsLoading(true);
          if (error.response.status === 403) {
            toast.warn("You are not authorized to access that page");
            navigate("/");
          } else {
            toast.error(error.response?.data?.message || error.message);
          }
          return;
        });
    };

    fetchInvoiceData();

  }, [apiUrl, authKey, navigate]);

  return (
    <>
      <Navbar />
      <main className="p-16">
        <AdminPanel />
        <section className="admin-dashboard">
          {isLoading && (
            <table className="text-center w-full my-8 border-collapse text-[1.2rem] overflow-auto">
              <thead className="text-khamco-primary font-bold bg-[#ddd]">
                <tr>
                  <td>Loading...</td>
                </tr>
              </thead>
              <tbody>
                <tr className="bg-[#aaa] animate-pulse text-[#aaa] h-12"><td>k</td></tr>
                <tr className="bg-[#aaa] animate-pulse text-[#aaa] h-12"><td>k</td></tr>
                <tr className="bg-[#aaa] animate-pulse text-[#aaa] h-12"><td>k</td></tr>
              </tbody>
            </table>
          )}
          {display && (
            <table className="w-full my-8 border-collapse text-[1.2rem] overflow-auto">
              <caption className="text-khamco-primary font-bold mb-4">Recent Invoice Data</caption>
              <thead>
                <tr>
                  <td>Customer</td>
                  <td>Date</td>
                  <td>Invoices Created</td>
                  <td>Invoices Deleted</td>
                </tr>
              </thead>
              <tbody>
                {invoiceData &&
                  invoiceData.map((entry, index) => (
                    <tr key={index}>
                      <td>
                        {entry.customer_name} {entry.customer_surname}
                      </td>
                      <td>
                        {new Date(entry.date).toLocaleDateString("en-US", {
                          month: "long",
                          day: "numeric",
                          year: "numeric",
                        })}
                      </td>
                      <td>{entry.total_invoices_created}</td>
                      <td>{entry.total_invoices_deleted}</td>
                    </tr>
                  ))}
              </tbody>
            </table>
          )}
        </section>
      </main>
      <Footer />
    </>
  );
};

export default AdminInvoiceData;
